const getUrl=(text)=>{
    var Url =(text.match(/(https?:\/\/[^\s]+)/g))
    return !Url ? null : (
      <div>
        <ul>
          {
            Url.map(item =>{
              return <li>
                <span>
                  <a href={item}></a>
                </span>
              </li>    
            })
          }
        </ul>
      </div>
    )
  }
  export default getUrl;
